import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <nav
      style={{
        background: "#1a1a1a",
        padding: "12px 24px",
        display: "flex",
        justifyContent: "space-between",
        alignItems: "center",
        borderBottom: "1px solid #333",
        position: "sticky",
        top: 0,
        zIndex: 999,
      }}
    >
      <Link
        to="/"
        style={{
          display: "flex",
          alignItems: "center",
          gap: "10px",
          color: "#ffd700",
          fontSize: "20px",
          textDecoration: "none",
          fontWeight: "bold",
        }}
      >
        <img
          src="/favicon.png"
          alt="Editly Logo"
          style={{ width: "30px", height: "30px", objectFit: "contain" }}
        />
        Editly
      </Link>

      <div style={{ display: "flex", gap: "20px" }}>
        <Link
          to="/"
          style={navLinkStyle}
          onMouseOver={(e) => (e.target.style.color = "#ffd700")}
          onMouseOut={(e) => (e.target.style.color = "white")}
        >
          Home
        </Link>
        <Link
          to="/about"
          style={navLinkStyle}
          onMouseOver={(e) => (e.target.style.color = "#ffd700")}
          onMouseOut={(e) => (e.target.style.color = "white")}
        >
          About
        </Link>
        <Link
          to="/contact"
          style={navLinkStyle}
          onMouseOver={(e) => (e.target.style.color = "#ffd700")}
          onMouseOut={(e) => (e.target.style.color = "white")}
        >
          Contact
        </Link>
      </div>
    </nav>
  );
}

const navLinkStyle = {
  color: "white",
  textDecoration: "none",
  fontSize: "16px",
};

export default Navbar;
